INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (1, 1, 'Non molestiae eligendi expedita nostrum quaerat et.', 'Ea eos laborum voluptatum enim ullam. Voluptatem consequatur quam quam dolorum voluptatem libero. Et et ex autem id illum excepturi dolore fugit. Est et assumenda neque est.', 'Corrupti voluptas odit blanditiis nihil sapiente. Et quia tenetur id dolorem sunt qui ad.', '1975-12-07');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (2, 2, 'Accusantium vel ea ad ullam rerum molestiae.', 'Excepturi aut et quo maxime quidem nihil. Nostrum deserunt aliquam recusandae nam. Nihil eos doloribus voluptatem.', 'Vel sit repellendus minus possimus natus aut. Harum voluptas et laboriosam. Dolorum sint dolores voluptatum rem et. Nobis labore iusto nihil quibusdam totam et.', '2001-10-01');
INSERT INTO `posts` (`id`, `author_id`, `title`, `description`, `content`, `date`) VALUES (3, 3, 'Ut quae sint aut numquam nihil cum sunt laudantium.', 'Accusamus voluptas autem blanditiis ut. Iusto et et similique repellendus nihil cupiditate quo. Quidem tempora cupiditate et adipisci. Debitis eaque ea perferendis porro. Rerum repudiandae ab explicabo consectetur non.', 'Inventore et ex optio id est cumque soluta. Earum iste porro cumque sit quis assumenda.\nDolorem vel tenetur quas dolorem. Mollitia animi numquam tempore sunt. Magnam molestiae et officia.', '2012-09-19');
